import { useParams } from "react-router-dom";

export const PlaygroundScreen = () => {
  const params = useParams();
  const { fileId, folderId } = params;

  return (
    <div className="playground-container">
      <div className="header">
        <img src="./logo.png" />
      </div>
      {/* <EditorContainer /> */}
    </div>
  );
};
